import React from 'react'
import DataTable from 'react-data-table-component';

export const LoanTable = (props) => {
  console.log(props.loans);
  
  const columns=[
    {
      name: 'LoanID',
      selector: row => row.LoanID,
  },
    {
      name: 'FullName',
      selector: row => row.FullName,
  },
    {
      name: 'CardNumber',
      selector: row => row.CardNumber,
  },
    {
      name: 'LoanAgreementNo',
      selector: row => row.LoanAgreementNo,
  },
    {
      name: 'DisburseDate',
      selector: row => row.DisburseDate,
  },
    {
      name: 'CloseDate',
      selector: row => row.CloseDate,
  },
    {
      name: 'LoanNode',
      selector: row => row.LoanNode,
  },
    {
      name: 'Status',
      selector: row => row.Status,
  },
  ];

  const data = [
    {
      LoanID: 1,
      FullName: 'Beetlejuice',
      CardNumber: '1988',
      LoanAgreementNo: 1,
      DisburseDate: 'Beetlejuice',
      DisburseDate: '1988',
      CloseDate: 1,
      LoanNode: 'Beetlejuice',
      Status: '1988',
    }
]

  return (

    <DataTable columns={columns} data={data} />
  )
}
